kedToken; //accumulate to cal reward mapping(address => uint256) public totalRewardsDistributedToken; //total reward distributed of token mapping(address => bool) public isActive; // token address => isActive mapping(address => uint256) public indexOfAIgentFiToken; // token address => index mapping(address => mapping(address => User)) public users; // token => user address => info //user struct struct User { uint256 debtToken; // 1e18 uint256 harvestedRewardToken; // 1e18 uint256 pendingRewardToken; // 1e18 } Functions For client-side integration, you can loop from 0 to countTokens and call get aigentFiTokens(i) . A more optimized approach is to use multicall. function distributeRewardAgentFiToken(address _token, uint256 _amount) The distributeRewardAgentFiToken can only be called from partnerStakingAigentFi to distribute rewards for the tokens. function pendingRewardToken(address _token, address _sender) Function pendingRewardToken is used to calculate the reward amount for a specific token of a user. In the future, we will develop a function to retrieve rewards for all tokens belonging to each user. function harvest(address[] calldata _tokens) The harvestRewardToken function takes specific tokens as input to be harvested. Currently, it cannot process \"harvest all\" due to a bug on the partner side, which prevents the transfer of tokens in bonding curves. Once the system is stable, the \"harvest all\" functionality will be enabled. function users(address token, address staker) view returns (User memory) Read infomation of a staker depend on token address Events event AdminUpdated(address value); event AgentFiUpdated(address value); event TokenDistributed(address token, uint256 amount); event TokenHarvested(address indexed token, address indexed user, uint256 amount); event NotifyBalanceChange(address indexed staker, uint256 userStaked, uint256 changeAmount, bool inceaseOrDecrease);","breadcrumbs":"Defuture Contracts » Staking AIgentfi » 2. Documentation","id":"3",